import React from 'react';
import { useNavigate } from 'react-router-dom';
import Hero from "../components/Hero/heroComponent";
import Banner from "../components/banner/banner";
import Services from "../components/services/ServicesComponent";
import FeaturedRoom from "../components/FeaturedRoom/featuredRoom.component";


const MainPage = () => {
  return (
    <>
      <Hero>
        <Banner title="luxurious hotels" subtitle="luxurious hotels in Tehran, Kish, Ramsar, and Qeshm">
          <Link to="tehran" className="btn-primary">
            Tehran
          </Link>
        </Banner>
      </Hero>
      <Services></Services>
      <FeaturedRoom></FeaturedRoom>
    </>
  );
}

export default MainPage;
